import React, { Component } from "react";
import "./navbar.css";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <div id="wrapper">
        <div id="title">Receiply</div>
        <div id="navitemswrapper">
          <div class="navitem" id="login">
            Login
          </div>
          <div class="navitem" id="signup">
            Login
          </div>
        </div>
      </div>
    );
  }
}

export default Navbar;
